import React from "react";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";
import BusinessCenterIcon from "@mui/icons-material/BusinessCenter";

const Cart2 = ({ quality }) => {
  return (
    <Box className="Cart_2">
      <Box>
        <Link href="/cart" underline="none" className="">
        
          <Box>
            <BusinessCenterIcon />
          </Box>
          <Box>
            <Typography className="qualityText" gutterBottom variant="p" component="div">
              {quality}
            </Typography>
          </Box>
        </Link>
      </Box>
    </Box>
  );
};

export default Cart2;
